description:
Tear into a can of the meanest energy supplement on the planet, MONSTER energy. It's a wicked mega hit that delivers twice the buzz of a regular energy drink. The Monster packs a vicious punch but has a smooth kick ass flavour you can really pound down. So when it's time to unleash the beast within, grab a Monster and GO BIG !

Ingredients: 
Carbonated water, Sucrose, Glucose, Citric Acid, Natural Flavors, Taurine, Sodium Citrate, Color Added, Panax Ginseng Root Extract, L-Carnitine, Caffeine, Ascorbic Acid, Sorbic Acid, Benzic Acid, Niacinamide, Sodium Chloride, Glucuronolactone, Inositol, Guarana Seed Extract, Pyridoxine Hydrochloride, Sucralose, Riboflavin, Maltodextrin, Cyanobalmin.

Nutrition Facts: 
serving size 500ml; 
servings per container 2; 
calories 100; 
total carbs 26g; 
sugars 26g; 
vitamin c 60mg; 
riboflavin 1.7mg; 
niacin 20mg; 
vitamin b6 2mg; 
vitamin b12 6mcg; 
sodium 180mg; 
taurine 1000mg; 
panax-ginseng 200mg; 
energy blend 2500mg
